import Contact from './Components/Contact';
import Footer from './Components/Footer';



function App() {
  return (
    <div>
      <script src="https://kit.fontawesome.com/a7b4d738fb.js" crossorigin="anonymous"></script> 
      <div>

    <Navbar></Navbar>
    </div>
    <div>

    <Splash></Splash>
    </div>
    <div>
      <Footer></Footer>
    </div>
    <div>
      <Contact></Contact>
    </div>
    </div>
  );
}

export default App;
